    <script>
document.querySelector('a[data-transition="slide-left"]').addEventListener('click', function(e){
    e.preventDefault();
    const target = this.getAttribute('href');
    document.body.style.transition = 'transform 0.5s ease';
    document.body.style.transform = 'translateX(-100vw)';
    setTimeout(() => window.location.href = target, 500);
});
    </script>
<div class="content" id="content">
    <!-- Your homepage content here -->
</div>
<script>
const content = document.getElementById('content');

// Slide IN on page load
content.style.transform = 'translateX(100%)';
content.style.transition = 'transform 0.5s ease';

window.addEventListener('load', () => {
    requestAnimationFrame(() => {
        content.style.transform = 'translateX(0)';
    });
});

// Slide OUT on link click
document.querySelectorAll('a').forEach(link => {
    link.addEventListener('click', e => {
        const href = link.getAttribute('href');
        if (!href || href.startsWith('#')) return; // ignore anchors

        e.preventDefault();
        content.style.transform = 'translateX(-100%)'; // slide out

        // Wait for animation before navigating
        setTimeout(() => {
            window.location.href = href;
        }, 500); // must match transition duration
    });
});
</script>
    <script>
document.addEventListener('gesturestart', function (e) {
  e.preventDefault();
});
document.addEventListener('gesturechange', function (e) {
  e.preventDefault();
});
document.addEventListener('gestureend', function (e) {
  e.preventDefault();
});
</script>
